import { observable, action, makeObservable } from "mobx";
class BanksState {
 constructor() {
  makeObservable(this)
 }
 @observable banks = [];
 @observable mapBanks = {};

 @action
 setBanks = (val: any, val2: any) => {
  this.banks = val2;
  this.mapBanks = val;
 }

}
export default BanksState;
